import React from "react";

const About = () => {
  return (
    <div>
      <h1>About Contact Management System</h1>
      <p className="my-1">
        This Contact Management App is full stack MERN App for keeping track all
        your contact.
      </p>
      <p className="bg-dark p">
        <strong>Version:</strong> 1.0
      </p>
    </div>
  );
};

export default About;
